def valid_Palindrome(s):
    left =  0
    right = len(s) - 1
    while left < right:
        if s[left] == s[right]:
            left += 1
            right -= 1
        else:
            if half_Palindrome(s, left + 1, right):
                return left
            if half_Palindrome(s, left, right - 1):
                return right
            else:
                return -1
    return -2


def half_Palindrome(s, left, right):
    while left < right:
        if s[left] != s[right]:
            return False
        else:
            left += 1
            right -= 1
    return True


if __name__ == '__main__':
    s = ""
    if valid_Palindrome(s) == -1:
        print('not possible')
    elif valid_Palindrome(s) == -2:
        print('psiible without deleting')
    else:
        print('False')



